import React from "react";
import styled from "styled-components";

import "./style.css";
const cnst_bg = require("../../../assets/cnst_bg6.jpg").default;

const Input = styled.input`
  width: 90%;
  height: 50px;
  padding: 5px;
  margin-top: 30px;
  border: 0;
  border-bottom: 1px solid;
  outline: none;
  font-size: 20px;

  input::-webkit-outer-spin-button,
  input::-webkit-inner-spin-button {
    -webkit-appearance: none;
    margin: 0;
  }
`;

const Form = styled.div`
  height: 450px;
  max-width: 400px;
  min-width: 400px;
  background-color: white;
  margin-top: 5%;
  border: 1px solid;

  @media screen and (max-width: 850px) {
    margin-top: 15%;
  }
`;

const Main = styled.div`
  position: absolute;
  text-align: center;
  justify-content: space-around;
  color: white;
  background-image: url(${cnst_bg});
  background-repeat: no-repeat;
  background-position: center;
  background-size: cover;
  height: 70%;
`;

const Construction = () => {
  return (
    <div className="justify-content-center row">
      <Main className="row">
        <div className="col" style={{ maxWidth: "50%", minWidth: 400 }}>
          <p style={{ fontSize: 45, fontWeight: "bold", marginTop: "10%" }}>
            We build quality Homes
          </p>
          <p style={{ fontSize: 25 }}>100% Hassle-Free and managed by us!</p>
        </div>
        <Form className="col border-primary">
          <p style={{ backgroundColor: "red", fontSize: 25 }}>
            Book a free Consultation
          </p>
          <Input placeholder="Your name" type="text" />
          <Input placeholder="Your contact number" type="numbers" />
          <Input placeholder="Your email" type="email" />
          <Input placeholder="Your city" type="text" />
        </Form>
      </Main>
    </div>
  );
};

export default Construction;

